import React from 'react';
import './login.css';

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      username: "Priyankabauskar",
      password: "abc@123"
    };
    this.updatedusername = this.updatedusername.bind(this);
    this.updatedpassword = this.updatedpassword.bind(this);
  }
}
const login = (props) => {

    return(
        <div id="container">
        <label htmlFor="uname">
          <b>Username :</b>
        </label>
        <input
          type="text"
          placeholder="Enter Username"
          name="uname"
          onChange={event=> props.userHandler(event)}
        />

        <label htmlFor="psw">
          <b>Password :</b>
        </label>
        <input
          type="password"
          placeholder="Enter Password"
          name="psw"
          onChange={event => props.passwordHandler(event)}
        />

        <button type="submit" onClick={props.click}>
          Login
        </button>
      </div>
    );
}

export default login;
